import Typing from 'react-typing-animation'

const Index = () => (
    <div>
        <Typing>
            <div className='wrapper'>
                <Typing.Delay ms={500} />
                <span className='bio'>
                    For CS students, by CS students.
            </span>
            </div>
        </Typing>
        <style jsx>{`
        * {
            box-sizing: border-box;
          }
        wrapper > div{
            background: gray;
            padding: 1em;
        }

      `}</style>
    </div>
);

export default Index;
